function toN($size, $ints) {
	$mask = 2 ** $size - 1; // 4 = 0b1111, 5 = 0b11111

	for ($n = 0; $n < 4096; $n++) {
		$int = floor($n * $size / 32);
		$start = ($n * $size) % 32;
		$shift = 32 - $start - $size;

		// printf("%4s. %3s: %3s - %2s = ", $n, $int, $start, $shift);

		if ($shift >= 0) {
			$block = ($ints[$int] >> $shift) & $mask;
		}
		else {
			$shift = abs($shift);
			$shift2 = 32 - $shift;
			$block = (($ints[$int] << $shift) & $mask) | ($ints[$int+1] >> $shift2);
			$block = abs($block);
		}
		// printf("%2s\n", $block);
		echo "$block ";

		// if ($n == 256 * 2 - 1) break;
	}
}

function tob4($ints) {
	$plus = pow(2, 31);

	// print_r($ints);
	$bins = array_map(function($int) use ($plus) {
		$bin = str_pad(sprintf('%b', $int + $plus), 32, '0', STR_PAD_LEFT);
		return ($bin[0] ? '0' : '1') . substr($bin, 1);
	}, $ints);
	// echo implode(' ', $bins) . "\n\n";
	$bins2 = str_split(implode('', $bins), 4);
	// echo implode(' ', $bins2) . "\n\n";
	$b4s = array_map(function($b4) {
		return bindec($b4);
	}, $bins2);
	var_dump(count($b4s));
	echo implode(' ', $b4s);
}

function tob5($ints) {
	$plus = pow(2, 31);

	// print_r($ints);
	$bins = array_map(function($int) use ($plus) {
		$bin = str_pad(sprintf('%b', $int + $plus), 32, '0', STR_PAD_LEFT);
		return ($bin[0] ? '0' : '1') . substr($bin, 1);
	}, $ints);
	// echo implode(' ', $bins) . "\n\n";
	$bins2 = str_split(implode('', $bins), 5);
	// echo implode(' ', $bins2) . "\n\n";
	$b5s = array_map(function($b5) {
		return bindec($b5);
	}, $bins2);
	var_dump(count($b5s));
	echo implode(' ', $b5s);
}

function printLegend($blocks) {
	echo "\n\n";
	foreach ($blocks as $i => $type) {
		printf("%2s = %s\n", $i, $type);
	}
	echo "\n\n\n";
}
